def find_kth_sum(k):
    max_length = 12  # Sufficient to cover all required values up to N = 333
    repunits = [int('1' * i) for i in range(1, max_length + 1)]
    sums = set()

    for a in repunits:
        for b in repunits:
            for c in repunits:
                sums.add(a + b + c)

    sorted_sums = sorted(sums)
    return sorted_sums[k - 1]

