from collections import deque

def main():
    import sys
    input = sys.stdin.read
    grid = input().strip().split()
    rows = len(grid)
    cols = len(grid[0]) if rows > 0 else 0

    component_id = [[-1] * cols for _ in range(rows)]
    current_id = 0

    # Step 1: Find all green components using BFS
    for i in range(rows):
        for j in range(cols):
            if grid[i][j] == 'G' and component_id[i][j] == -1:
                queue = deque()
                queue.append((i, j))
                component_id[i][j] = current_id
                while queue:
                    x, y = queue.popleft()
                    for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                        nx, ny = x + dx, y + dy
                        if 0 <= nx < rows and 0 <= ny < cols:
                            if grid[nx][ny] == 'G' and component_id[nx][ny] == -1:
                                component_id[nx][ny] = current_id
                                queue.append((nx, ny))
                current_id += 1

    C = current_id
    R = 0
    sum_k = 0

    # Step 2: Count red cells and their adjacent green components
    for i in range(rows):
        for j in range(cols):
            if grid[i][j] == 'R':
                R += 1
                unique_components = set()
                for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                    ni, nj = i + dx, j + dy
                    if 0 <= ni < rows and 0 <= nj < cols:
                        if grid[ni][nj] == 'G':
                            unique_components.add(component_id[ni][nj])
                sum_k += len(unique_components)

    MOD = 10**9 + 7

    if R == 0:
        print(0)
    else:
        numerator = ((C + 1) * R - sum_k) % MOD
        denominator = R
        inv_denominator = pow(denominator, MOD - 2, MOD)
        result = (numerator * inv_denominator) % MOD
        print(result)

